INSERT INTO `variable` VALUES ('module_filter_remember_active_tab','i:1;'),('module_filter_remember_update_state','i:0;'),('module_filter_set_focus','i:1;'),('module_filter_tabs','i:1;'),('module_filter_track_recent_modules','i:1;'),('module_filter_use_switch','i:0;'),('module_filter_use_url_fragment','i:1;'),('module_filter_visual_aid','i:1;'),('node_admin_theme','i:1;'),('node_options_page','a:1:{i:0;s:6:"status";}'),('node_submitted_page','b:0;'),('path_alias_whitelist','a:0:{}'),('services_security_update_1','b:1;'),('site_default_country','s:2:"GB";'),('site_mail','s:30:"hannes.kirsman@wunderkraut.com";'),('site_name','s:18:"Drupal 7 Benchmark";'),('themekey_attributes','a:74:{s:11:"comment:cid";a:3:{s:11:"description";s:242:"Comment: ID - The id of a comment (cid). See <a href="/admin/content/comment">admin/content/comment</a> for your published comments or <a href="/admin/content/comment/approval">admin/content/comment/approval</a> for comments awaiting approval";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:16:"drupal:base_path";a:2:{s:11:"description";s:123:"Drupal: Base path - If Drupal is installed in a subdirectory, the base path will be ''/[subdirectory]/'', otherwise just ''/''.";s:10:"page cache";i:1;}s:12:"drupal:get_q";a:3:{s:11:"description";s:66:"Drupal: $_GET[''q''] - Current value of Drupal''s query parameter "q"";s:9:"validator";s:0:"";s:10:"page cache";i:1;}s:20:"drupal:is_front_page";a:3:{s:11:"description";s:85:"Drupal: Is front page - ''true'' if current page is front page, otherwise just ''false''.";s:9:"validator";s:33:"themekey_validator_string_boolean";s:10:"page cache";i:1;}s:11:"drupal:path";a:3:{s:11:"description";s:1313:"Drupal: Drupal path like "node/add/story" or path alias with support for wildcards.<br />\nQuery parameters are stripped off before the path gets examined. P.e. "node/add/story?destination=node" becomes "node/add/story" first. If you want to access query parameters, have a look at the <strong>system:query_param</strong> property.<br />\nWildcard characters are "#" for numeric parts and "%" for all characters. To match conditions against a certain part, use an identifier with the wildcard. For example "comment/reply/#xyz" matches all paths with "comment/reply" and a numeric third argument. You can then specify conditions for every wildcard argument using the property "drupal:path:wildcard" and the identifier you choose ("xyz" in this example).<br />\nThese are the possible wildcard replacements for foo/bar/42/test.html:<pre>\nfoo/bar/42/test.html\nfoo/bar/42/%\nfoo/bar/42\nfoo/bar/%/test.html\nfoo/bar/%/%\nfoo/bar/%\nfoo/bar/#/test.html\nfoo/bar/#/%\nfoo/bar/#\nfoo/bar\nfoo/%/42/test.html\nfoo/%/42/%\nfoo/%/42\nfoo/%/%/test.html\nfoo/%/%/%\nfoo/%/%\nfoo/%/#/test.html\nfoo/%/#/%\nfoo/%/#\nfoo/%\nfoo\n%/bar/42/test.html\n%/bar/42/%\n%/bar/42\n%/bar/%/test.html\n%/bar/%/%\n%/bar/%\n%/bar/#/test.html\n%/bar/#/%\n%/bar/#\n%/bar\n%/%/42/test.html\n%/%/42/%\n%/%/42\n%/%/%/test.html\n%/%/%/%\n%/%/%\n%/%/#/test.html\n%/%/#/%\n%/%/#\n%/%\n%\n</pre>";s:9:"validator";s:30:"themekey_validator_drupal_path";s:10:"page cache";i:1;}s:20:"drupal:path:wildcard";a:3:{s:11:"description";s:72:"Wildcard of "drupal:path". See explanation of "drupal:path" for details.";s:9:"validator";s:27:"themekey_validator_wildcard";s:10:"page cache";i:1;}s:20:"drupal:path_is_admin";a:3:{s:11:"description";s:107:"Drupal: Path is admin - ''true'' if current page''s path belongs to the admin section, otherwise just ''false''.";s:9:"validator";s:33:"themekey_validator_string_boolean";s:10:"page cache";i:1;}s:15:"locale:language";a:3:{s:11:"description";s:202:"Locale: Language - The code of the current site language, formatted like "en" or "de" or "neutral". See <a href="/admin/config/language">admin/config/language</a> for the codes of your enabled languages";s:9:"validator";s:27:"themekey_validator_language";s:10:"page cache";i:1;}s:23:"locale:language_content";a:3:{s:11:"description";s:213:"Locale: Language Content - The code of the current content language, formatted like "en" or "de" or "neutral". See <a href="/admin/config/language">admin/config/language</a> for the codes of your enabled languages";s:9:"validator";s:27:"themekey_validator_language";s:10:"page cache";i:1;}s:28:"locale:language_from_browser";a:3:{s:11:"description";s:108:"Locale: Language From Browser - Identify best matching language from the Accept-language HTTP header we got.";s:9:"validator";s:27:"themekey_validator_language";s:10:"page cache";i:0;}s:16:"node:body_format";a:2:{s:11:"description";s:201:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">format</em> of the field <em class="placeholder">body</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:17:"node:body_summary";a:2:{s:11:"description";s:202:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">summary</em> of the field <em class="placeholder">body</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:15:"node:body_value";a:2:{s:11:"description";s:200:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">value</em> of the field <em class="placeholder">body</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:12:"node:changed";a:3:{s:11:"description";s:115:"Node: Changed date - The date when the node was last edited/updated, formatted as unix timestamp like "1248873565".";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:17:"node:changed_date";a:3:{s:11:"description";s:113:"Node: Changed date - The date without the time when the node was last edited/updated, formatted like "2009-12-24"";s:9:"validator";s:23:"themekey_validator_date";s:10:"page cache";i:1;}s:22:"node:changed_date_time";a:3:{s:11:"description";s:124:"Node: Changed date - The date including the time when the node was last edited/updated, formatted like "2009-12-24 18:13:24"";s:9:"validator";s:28:"themekey_validator_date_time";s:10:"page cache";i:1;}s:12:"node:created";a:3:{s:11:"description";s:103:"Node: Created date - The date when the node was created, formatted as unix timestamp like "1248873565".";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:17:"node:created_date";a:3:{s:11:"description";s:101:"Node: Created date - The date without the time when the node was created, formatted like "2009-12-24"";s:9:"validator";s:23:"themekey_validator_date";s:10:"page cache";i:1;}s:22:"node:created_date_time";a:3:{s:11:"description";s:112:"Node: Created date - The date including the time when the node was created, formatted like "2009-12-24 18:13:24"";s:9:"validator";s:28:"themekey_validator_date_time";s:10:"page cache";i:1;}s:20:"node:field_image_alt";a:2:{s:11:"description";s:205:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">alt</em> of the field <em class="placeholder">field_image</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:20:"node:field_image_fid";a:2:{s:11:"description";s:205:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">fid</em> of the field <em class="placeholder">field_image</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:23:"node:field_image_height";a:2:{s:11:"description";s:208:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">height</em> of the field <em class="placeholder">field_image</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:22:"node:field_image_title";a:2:{s:11:"description";s:207:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">title</em> of the field <em class="placeholder">field_image</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:22:"node:field_image_width";a:2:{s:11:"description";s:207:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">width</em> of the field <em class="placeholder">field_image</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:19:"node:field_tags_tid";a:2:{s:11:"description";s:204:"Node: Field Value - The (simple scalar) value of the column <em class="placeholder">tid</em> of the field <em class="placeholder">field_tags</em>. The value will be converted in its string representation.";s:10:"page cache";i:1;}s:13:"node:language";a:3:{s:11:"description";s:207:"Node: Language - The code of the selected language of a node (formatted like "en" or "de") or "neutral". See <a href="/admin/config/language">admin/config/language</a> for the codes of your enabled languages";s:9:"validator";s:27:"themekey_validator_language";s:10:"page cache";i:1;}s:8:"node:nid";a:3:{s:11:"description";s:110:"Node: ID - The id of a node (nid), can be found in the URL of the node, "node/23" or "node/23/edit" (23 = nid)";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:12:"node:promote";a:3:{s:11:"description";s:111:"Node: Promoted - If the node is promoted to the front page. Possible values are "0" for true and "1" for false.";s:9:"validator";s:34:"themekey_validator_numeric_boolean";s:10:"page cache";i:1;}s:11:"node:sticky";a:3:{s:11:"description";s:111:"Node: Sticky - If the node is set "Sticky at top of lists". Possible values are "0" for true and "1" for false.";s:9:"validator";s:34:"themekey_validator_numeric_boolean";s:10:"page cache";i:1;}s:10:"node:title";a:2:{s:11:"description";s:36:"Node: Title - The title of the node.";s:10:"page cache";i:1;}s:9:"node:type";a:3:{s:11:"description";s:211:"Node: Type - The machine-readable content type of the node. See <a href="/admin/structure/types">admin/structure/types</a> for your content types (use column "Type"). Drupal default types are "page" and "story".";s:9:"validator";s:28:"themekey_validator_node_type";s:10:"page cache";i:1;}s:8:"node:uid";a:3:{s:11:"description";s:229:"Node: User ID - The node author''s user id (uid). The user id can be found in the URL of the user''s profile page, "user/23" or "user/23/edit" (23 = uid). See <a href="/admin/user/user/list">admin/user/user/list</a> for your users.";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:8:"node:vid";a:3:{s:11:"description";s:145:"Node: The version id of a node (vid), mostly for internal use within ThemeKey. In most cases it''s better to use node:nid within your rule chains.";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:1;}s:15:"path:node_alias";a:3:{s:11:"description";s:53:"Path: Node alias - The path alias assigned to a node.";s:9:"validator";s:0:"";s:10:"page cache";i:1;}s:13:"system:cookie";a:2:{s:11:"description";s:111:"System: Cookie - Every single cookie and its value if present will be formatted like ''COOKIE_NAME=COOKIE_VALUE''";s:10:"page cache";i:0;}s:11:"system:date";a:3:{s:11:"description";s:68:"System: Date - Current time formatted as Y-m-d (example: 2009-12-24)";s:9:"validator";s:23:"themekey_validator_date";s:10:"page cache";i:2;}s:16:"system:date_time";a:3:{s:11:"description";s:88:"System: Date Time - Current time formatted as Y-m-d H:i:s (example: 2009-12-24 18:30:10)";s:9:"validator";s:28:"themekey_validator_date_time";s:10:"page cache";i:2;}s:19:"system:day_of_month";a:3:{s:11:"description";s:67:"System: Day of Month - Current day of the month formatted as 1 - 31";s:9:"validator";s:31:"themekey_validator_day_of_month";s:10:"page cache";i:2;}s:18:"system:day_of_week";a:3:{s:11:"description";s:92:"System: Day of Week - Current day of the week formatted as three letters ''Mon'' through ''Sun''";s:9:"validator";s:30:"themekey_validator_day_of_week";s:10:"page cache";i:2;}s:12:"system:dummy";a:2:{s:11:"description";s:55:"System: Dummy - Dummy property. Value