:56:"System: Random - A random value that could be ''0'' or 1''.";s:9:"validator";s:34:"themekey_validator_numeric_boolean";s:10:"page cache";i:0;}s:14:"system:referer";a:2:{s:11:"description";s:279:"System: ''HTTP_REFERER'' - The address of the page (if any) which referred the user agent to the current page. This is set by the user agent. Not all user agents will set this, and some provide the ability to modify HTTP_REFERER as a feature. In short, it cannot really be trusted.";s:10:"page cache";i:0;}s:16:"system:remote_ip";a:3:{s:11:"description";s:87:"System: ''REMOTE_ADDR'' - The IP address from which the user is viewing the current page.";s:9:"validator";s:29:"themekey_validator_ip_address";s:10:"page cache";i:0;}s:16:"system:server_ip";a:3:{s:11:"description";s:97:"System: ''SERVER_ADDR'' - The IP address of the server under which the current script is executing.";s:9:"validator";s:29:"themekey_validator_ip_address";s:10:"page cache";i:0;}s:18:"system:server_name";a:2:{s:11:"description";s:195:"System:  ''SERVER_NAME'' - The name of the server host under which the current script is executing. If the script is running on a virtual host, this will be the value defined for that virtual host.";s:10:"page cache";i:0;}s:18:"system:server_port";a:3:{s:11:"description";s:229:"System: ''SERVER_PORT'' - The port on the server machine being used by the web server for communication. For default setups, this will be ''80''; using SSL, for instance, will change this to whatever your defined secure HTTP port is.";s:9:"validator";s:30:"themekey_validator_ctype_digit";s:10:"page cache";i:0;}s:14:"system:session";a:2:{s:11:"description";s:199:"System: Session - Every single session parameter and its value, if a value is present and a simple type (string, integer, boolean). Booleans are represented as integers; ''1'' as TRUE and ''0'' as FALSE.";s:10:"page cache";i:1;}s:11:"system:time";a:3:{s:11:"description";s:66:"System: Time - Current time formatted as H:i:s (example: 18:30:1