),   KEY `comment_nid_language` (`nid`,`language`),   KEY `comment_created` (`created`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores comments and associated data.' AUTO_INCREMENT=1;
