CREATE TABLE `filter_format` (   `format` varchar(255) NOT NULL COMMENT 'Primary Key: Unique machine name of the format.',   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'Name of the text format (Filtered HTML).',   `cache` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Flag to indicate whether format is cacheable. (1 = cacheable, 0 = not cacheable)',   `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT 'The status of the text format. (1 = enabled, 0 = disabled)',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'Weight of text format to use when listing.',   PRIMARY KEY (`format`),   UNIQUE KEY `name` (`name`),   KEY `status_weight` (`status`,`weight`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores text formats: custom groupings of filters, such as...';
DROP TABLE IF EXISTS `flood`;
CREATE TABLE `flood` (   `fid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Unique flood event ID.',   `event` varchar(64) NOT NULL DEFAULT '' COMMENT 'Name of event (e.g. contact).',   `identifier` varchar(128) NOT NULL DEFAULT '' COMMENT 'Identifier of the visitor, such as an IP address or hostname.',   `timestamp` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp of the event.',   `expiration` int(11) NOT NULL DEFAULT '0' COMMENT 'Expiration timestamp. Expired events are purged on cron run.',   PRIMARY KEY (`fid`),   KEY `allow` (`event`,`identifier`,`timestamp`),   KEY `purge` (`expiration`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Flood controls the threshold of events, such as the...' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `history`;
CREATE TABLE `history` (   `uid` int(11) NOT NULL DEFAULT '0' COMMENT 'The users.uid that read the node nid.',   `nid` int(11) NOT NULL DEFAULT '0' COMMENT 'The node.nid that was read.',   `timestamp` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp at which the read occurred.',   PRIMARY KEY (`uid`,`nid`),   KEY `nid` (`nid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='A record of which users have read which nodes.';
DROP TABLE IF EXISTS `i18n_block_language`;
CREATE TABLE `i18n_block_language` (   `module` varchar(64) NOT NULL COMMENT 'The block’s origin module, from block.module.',   `delta` varchar(32) NOT NULL COMMENT 'The block’s unique delta within module, from block.delta.',   `language` varchar(12) NOT NULL DEFAULT '' COMMENT 'Language code, e.g. ’de’ or ’en-US’.',   PRIMARY KEY (`module`,`delta`,`language`),   KEY `language` (`language`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Sets block visibility based on language';
DROP TABLE IF EXISTS `i18n_string`;
CREATE TABLE `i18n_string` (   `lid` int(11) NOT NULL DEFAULT '0' COMMENT 'Source string ID. References locales_source.lid.',   `textgroup` varchar(50) NOT NULL DEFAULT 'default' COMMENT 'A module defined group of translations, see hook_locale().',   `context` varchar(255) NOT NULL DEFAULT '' COMMENT 'Full string ID for quick search: type:objectid:property.',   `objectid` varchar(255) NOT NULL DEFAULT '' COMMENT 'Object ID.',   `type` varchar(255) NOT NULL DEFAULT '' COMMENT 'Object type for this string.',   `property` varchar(255) NOT NULL DEFAULT '' COMMENT 'Object property for this string.',   `objectindex` int(11) NOT NULL DEFAULT '0' COMMENT 'Integer value of Object ID.',   `format` varchar(255) DEFAULT NULL COMMENT 'The filter_format.format of the string.',   PRIMARY KEY (`lid`),   KEY `group_context` (`textgroup`,`context`(50)) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Metadata for source strings.';
DROP TABLE IF EXISTS `image_effects`;
CREATE TABLE `image_effects` (   `ieid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The primary identifier for an image effect.',   `isid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The image_styles.isid for an image style.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The weight of the effect in the style.',   `name` varchar(255) NOT NULL COMMENT 'The unique name of the effect to be executed.',   `data` longblob NOT NULL COMMENT 'The configuration data for the effect.',   PRIMARY KEY (`ieid`),   KEY `isid` (`isid`),   KEY `weight` (`weight`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores configuration options for image effects.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `image_styles`;
CREATE TABLE `image_styles` (   `isid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The primary identifier for an image style.',   `name` varchar(255) NOT NULL COMMENT 'The style machine name.',   `label` varchar(255) NOT NULL DEFAULT '' COMMENT 'The style administrative name.',   PRIMARY KEY (`isid`),   UNIQUE KEY `name` (`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores configuration options for image styles.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `languages`;
CREATE TABLE `languages` (   `language` varchar(12) NOT NULL DEFAULT '' COMMENT 'Language code, e.g. ’de’ or ’en-US’.',   `name` varchar(64) NOT NULL DEFAULT '' COMMENT 'Language name in English.',   `native` varchar(64) NOT NULL DEFAULT '' COMMENT 'Native language name.',   `direction` int(11) NOT NULL DEFAULT '0' COMMENT 'Direction of language (Left-to-Right = 0, Right-to-Left = 1).',   `enabled` int(11) NOT NULL DEFAULT '0' COMMENT 'Enabled flag (1 = Enabled, 0 = Disabled).',   `plurals` int(11) NOT NULL DEFAULT '0' COMMENT 'Number of plural indexes in this language.',   `formula` varchar(255) NOT NULL DEFAULT '' COMMENT 'Plural formula in PHP code to evaluate to get plural indexes.',   `domain` varchar(128) NOT NULL DEFAULT '' COMMENT 'Domain to use for this language.',   `prefix` varchar(128) NOT NULL DEFAULT '' COMMENT 'Path prefix to use for this language.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'Weight, used in lists of languages.',   `javascript` varchar(64) NOT NULL DEFAULT '' COMMENT 'Location of JavaScript translation file.',   PRIMARY KEY (`language`),   KEY `list` (`weight`,`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='List of all available languages in the system.';
DROP TABLE IF EXISTS `locales_source`;
CREATE TABLE `locales_source` (   `lid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Unique identifier of this string.',   `location` longtext COMMENT 'Drupal path in case of online discovered translations or file path in case of imported strings.',   `textgroup` varchar(255) NOT NULL DEFAULT 'default' COMMENT 'A module defined group of translations, see hook_locale().',   `source` blob NOT NULL COMMENT 'The original string in English.',   `context` varchar(255) NOT NULL DEFAULT '' COMMENT 'The context this string applies to.',   `version` varchar(20) NOT NULL DEFAULT 'none' COMMENT 'Version of Drupal, where the string was last used (for locales optimization).',   PRIMARY KEY (`lid`),   KEY `source_context` (`source`(30),`context`),   KEY `textgroup_context` (`textgroup`,`context`(50)) ) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 COMMENT='List of English source strings.' AUTO_INCREMENT=40;
DROP TABLE IF EXISTS `locales_target`;
CREATE TABLE `locales_target` (   `lid` int(11) NOT NULL DEFAULT '0' COMMENT 'Source string ID. References locales_source.lid.',   `translation` blob NOT NULL COMMENT 'Translation string value in this language.',   `language` varchar(12) NOT NULL DEFAULT '' COMMENT 'Language code. References languages.language.',   `plid` int(11) NOT NULL DEFAULT '0' COMMENT 'Parent lid (lid of the previous string in the plural chain) in case of plural strings. References locales_source.lid.',   `plural` int(11) NOT NULL DEFAULT '0' COMMENT 'Plural index number in case of plural strings.',   `i18n_status` int(11) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating whether this translation needs to be updated.',   PRIMARY KEY (`language`,`lid`,`plural`),   KEY `lid` (`lid`),   KEY `plid` (`plid`),   KEY `plural` (`plural`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores translated versions of strings.';
DROP TABLE IF EXISTS `menu_custom`;
CREATE TABLE `menu_custom` (   `menu_name` varchar(32) NOT NULL DEFAULT '' COMMENT 'Primary Key: Unique key for menu. This is used as a block delta so length is 32.',   `title` varchar(255) NOT NULL DEFAULT '' COMMENT 'Menu title; displayed at top of block.',   `description` text COMMENT 'Menu description.',   PRIMARY KEY (`menu_name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Holds definitions for top-level custom menus (for example...';
DROP TABLE IF EXISTS `menu_links`;
CREATE TABLE `menu_links` (   `menu_name` varchar(32) NOT NULL DEFAULT '' COMMENT 'The menu name. All links with the same menu name (such as ’navigation’) are part of the same menu.',   `mlid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The menu link ID (mlid) is the integer primary key.',   `plid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The parent link ID (plid) is the mlid of the link above in the hierarchy, or zero if the link is at the top level in its menu.',   `link_path` varchar(255) NOT NULL DEFAULT '' COMMENT 'The Drupal path or external path this link points to.',   `router_path` varchar(255) NOT NULL DEFAULT '' COMMENT 'For links corresponding to a Drupal path (external = 0), this connects the link to a menu_router.path for joins.',   `link_title` varchar(255) NOT NULL DEFAULT '' COMMENT 'The text displayed for the link, which may be modified by a title callback stored in menu_router.',   `options` blob COMMENT 'A serialized array of options to be passed to the url() or l() function, such as a query string or HTML attributes.',   `module` varchar(255) NOT NULL DEFAULT 'system' COMMENT 'The name of the module that generated this link.',   `hidden` smallint(6) NOT NULL DEFAULT '0' COMMENT 'A flag for whether the link should be rendered in menus. (1 = a disabled menu item that may be shown on admin screens, -1 = a menu callback, 0 = a normal, visible link)',   `external` smallint(6) NOT NULL DEFAULT '0' COMMENT 'A flag to indicate if the link points to a full URL starting with a protocol, like http:// (1 = external, 0 = internal).',   `has_children` smallint(6) NOT NULL DEFAULT '0' COMMENT 'Flag indicating whether any links have this link as a parent (1 = children exist, 0 = no children).',   `expanded` smallint(6) NOT NULL DEFAULT '0' COMMENT 'Flag for whether this link should be rendered as expanded in menus - expanded links always have their child links displayed, instead of only when the link is in the active trail (1 = expanded, 0 = not expanded)',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'Link weight among links in the same menu at the same depth.',   `depth` smallint(6) NOT NULL DEFAULT '0' COMMENT 'The depth relative to the top level. A link with plid == 0 will have depth == 1.',   `customized` smallint(6) NOT NULL DEFAULT '0' COMMENT 'A flag to indicate that the user has manually created or edited the link (1 = customized, 0 = not customized).',   `p1` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The first mlid in the materialized path. If N = depth, then pN must equal the mlid. If depth > 1 then p(N-1) must equal the plid. All pX where X > depth must equal zero. The columns p1 .. p9 are also called the parents.',   `p2` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The second mlid in the materialized path. See p1.',   `p3` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The third mlid in the materialized path. See p1.',   `p4` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The fourth mlid in the materialized path. See p1.',   `p5` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The fifth mlid in the materialized path. See p1.',   `p6` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The sixth mlid in the materialized path. See p1.',   `p7` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The seventh mlid in the materialized path. See p1.',   `p8` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The eighth mlid in the materialized path. See p1.',   `p9` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The ninth mlid in the materialized path. See p1.',   `updated` smallint(6) NOT NULL DEFAULT '0' COMMENT 'Flag that indicates that this link was generated during the update from Drupal 5.',   PRIMARY KEY (`mlid`),   KEY `path_menu` (`link_path`(128),`menu_name`),   KEY `menu_plid_expand_child` (`menu_name`,`plid`,`expanded`,`has_children`),   KEY `menu_parents` (`menu_name`,`p1`,`p2`,`p3`,`p4`,`p5`,`p6`,`p7`,`p8`,`p9`),   KEY `router_path` (`router_path`(128)) ) ENGINE=InnoDB AUTO_INCREMENT=584 DEFAULT CHARSET=utf8 COMMENT='Contains the individual links within a menu.' AUTO_INCREMENT=584;
DROP TABLE IF EXISTS `menu_router`;
CREATE TABLE `menu_router` (   `path` varchar(255) NOT NULL DEFAULT '' COMMENT 'Primary Key: the Drupal path this entry describes',   `load_functions` blob NOT NULL COMMENT 'A serialized array of function names (like node_load) to be called to load an object corresponding to a part of the current path.',   `to_arg_functions` blob NOT NULL COMMENT 'A serialized array of function names (like user_uid_optional_to_arg) to be called to replace a part of the router path with another string.',   `access_callback` varchar(255) NOT NULL DEFAULT '' COMMENT 'The callback which determines the access to this router path. Defaults to user_access.',   `access_arguments` blob COMMENT 'A serialized array of arguments for the access callback.',   `page_callback` varchar(255) NOT NULL DEFAULT '' COMMENT 'The name of the function that renders the page.',   `page_arguments` blob COMMENT 'A serialized array of arguments for the page callback.',   `delivery_callback` varchar(255) NOT NULL DEFAULT '' COMMENT 'The name of the function that sends the result of the page_callback function to the browser.',   `fit` int(11) NOT NULL DEFAULT '0' COMMENT 'A numeric representation of how specific the path is.',   `number_parts` smallint(6) NOT NULL DEFAULT '0' COMMENT 'Number of parts in this router path.',   `context` int(11) NOT NULL DEFAULT '0' COMMENT 'Only for local tasks (tabs) - the context of a local task to control its placement.',   `tab_parent` varchar(255) NOT NULL DEFAULT '' COMMENT 'Only for local tasks (tabs) - the router path of the parent page (which may also be a local task).',   `tab_root` varchar(255) NOT NULL DEFAULT '' COMMENT 'Router path of the closest non-tab parent page. For pages that are not local tasks, this will be the same as the path.',   `title` varchar(255) NOT NULL DEFAULT '' COMMENT 'The title for the current page, or the title for the tab if this is a local task.',   `title_callback` varchar(255) NOT NULL DEFAULT '' COMMENT 'A function which will alter the title. Defaults to t()',   `title_arguments` varchar(255) NOT NULL DEFAULT '' COMMENT 'A serialized array of arguments for the title callback. If empty, the title will be used as the sole argument for the title callback.',   `theme_callback` varchar(255) NOT NULL DEFAULT '' COMMENT 'A function which returns the name of the theme that will be used to render this page. If left empty, the default theme will be used.',   `theme_arguments` varchar(255) NOT NULL DEFAULT '' COMMENT 'A serialized array of arguments for the theme callback.',   `type` int(11) NOT NULL DEFAULT '0' COMMENT 'Numeric representation of the type of the menu item, like MENU_LOCAL_TASK.',   `description` text NOT NULL COMMENT 'A description of this item.',   `position` varchar(255) NOT NULL DEFAULT '' COMMENT 'The position of the block (left or right) on the system administration page for this item.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'Weight of the element. Lighter weights are higher up, heavier weights go down.',   `include_file` mediumtext COMMENT 'The file to include for this element, usually the page callback function lives in this file.',   PRIMARY KEY (`path`),   KEY `fit` (`fit`),   KEY `tab_parent` (`tab_parent`(64),`weight`,`title`),   KEY `tab_root_weight_title` (`tab_root`(64),`weight`,`title`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Maps paths to various callbacks (access, page and title)';
DROP TABLE IF EXISTS `node`;
CREATE TABLE `node` (   `nid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The primary identifier for a node.',   `vid` int(10) unsigned DEFAULT NULL COMMENT 'The current node_revision.vid version identifier.',   `type` varchar(32) NOT NULL DEFAULT '' COMMENT 'The node_type.type of this node.',   `language` varchar(12) NOT NULL DEFAULT '' COMMENT 'The languages.language of this node.',   `title` varchar(255) NOT NULL DEFAULT '' COMMENT 'The title of this node, always treated as non-markup plain text.',   `uid` int(11) NOT NULL DEFAULT '0' COMMENT 'The users.uid that owns this node; initially, this is the user that created it.',   `status` int(11) NOT NULL DEFAULT '1' COMMENT 'Boolean indicating whether the node is published (visible to non-administrators).',   `created` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when the node was created.',   `changed` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when the node was most recently saved.',   `comment` int(11) NOT NULL DEFAULT '0' COMMENT 'Whether comments are allowed on this node: 0 = no, 1 = closed (read only), 2 = open (read/write).',   `promote` int(11) NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether the node should be displayed on the front page.',   `sticky` int(11) NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether the node should be displayed at the top of lists in which it appears.',   `tnid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The translation set id for this node, which equals the node id of the source post in each set.',   `translate` int(11) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating whether this translation page needs to be updated.',   PRIMARY KEY (`nid`),   UNIQUE KEY `vid` (`vid`),   KEY `node_changed` (`changed`),   KEY `node_created` (`created`),   KEY `node_frontpage` (`promote`,`status`,`sticky`,`created`),   KEY `node_status_type` (`status`,`type`,`nid`),   KEY `node_title_type` (`title`,`type`(4)),   KEY `node_type` (`type`(4)),   KEY `uid` (`uid`),   KEY `tnid` (`tnid`),   KEY `translate` (`translate`),   KEY `language` (`language`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='The base table for nodes.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `node_access`;
CREATE TABLE `node_access` (   `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The node.nid this record affects.',   `gid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The grant ID a user must possess in the specified realm to gain this row’s privileges on the node.',   `realm` varchar(255) NOT NULL DEFAULT '' COMMENT 'The realm in which the user must possess the grant ID. Each node access node can define one or more realms.',   `grant_view` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether a user with the realm/grant pair can view this node.',   `grant_update` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether a user with the realm/grant pair can edit this node.',   `grant_delete` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether a user with the realm/grant pair can delete this node.',   PRIMARY KEY (`nid`,`gid`,`realm`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Identifies which realm/grant pairs a user must possess in...';
DROP TABLE IF EXISTS `node_comment_statistics`;
CREATE TABLE `node_comment_statistics` (   `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The node.nid for which the statistics are compiled.',   `cid` int(11) NOT NULL DEFAULT '0' COMMENT 'The comment.cid of the last comment.',   `last_comment_timestamp` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp of the last comment that was posted within this node, from comment.changed.',   `last_comment_name` varchar(60) DEFAULT NULL COMMENT 'The name of the latest author to post a comment on this node, from comment.name.',   `last_comment_uid` int(11) NOT NULL DEFAULT '0' COMMENT 'The user ID of the latest author to post a comment on this node, from comment.uid.',   `comment_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The total number of comments on this node.',   PRIMARY KEY (`nid`),   KEY `node_comment_timestamp` (`last_comment_timestamp`),   KEY `comment_count` (`comment_count`),   KEY `last_comment_uid` (`last_comment_uid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Maintains statistics of node and comments posts to show ...';
DROP TABLE IF EXISTS `node_revision`;
CREATE TABLE `node_revision` (   `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The node this version belongs to.',   `vid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The primary identifier for this version.',   `uid` int(11) NOT NULL DEFAULT '0' COMMENT 'The users.uid that created this version.',   `title` varchar(255) NOT NULL DEFAULT '' COMMENT 'The title of this version.',   `log` longtext NOT NULL COMMENT 'The log entry explaining the changes in this version.',   `timestamp` int(11) NOT NULL DEFAULT '0' COMMENT 'A Unix timestamp indicating when this version was created.',   `status` int(11) NOT NULL DEFAULT '1' COMMENT 'Boolean indicating whether the node (at the time of this revision) is published (visible to non-administrators).',   `comment` int(11) NOT NULL DEFAULT '0' COMMENT 'Whether comments are allowed on this node (at the time of this revision): 0 = no, 1 = closed (read only), 2 = open (read/write).',   `promote` int(11) NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether the node (at the time of this revision) should be displayed on the front page.',   `sticky` int(11) NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether the node (at the time of this revision) should be displayed at the top of lists in which it appears.',   PRIMARY KEY (`vid`),   KEY `nid` (`nid`),   KEY `uid` (`uid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores information about each saved version of a node.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `node_type`;
CREATE TABLE `node_type` (   `type` varchar(32) NOT NULL COMMENT 'The machine-readable name of this type.',   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'The human-readable name of this type.',   `base` varchar(255) NOT NULL COMMENT 'The base string used to construct callbacks corresponding to this node type.',   `module` varchar(255) NOT NULL COMMENT 'The module defining this node type.',   `description` mediumtext NOT NULL COMMENT 'A brief description of this type.',   `help` mediumtext NOT NULL COMMENT 'Help information shown to the user when creating a node of this type.',   `has_title` tinyint(3) unsigned NOT NULL COMMENT 'Boolean indicating whether this type uses the node.title field.',   `title_label` varchar(255) NOT NULL DEFAULT '' COMMENT 'The label displayed for the title field on the edit form.',   `custom` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating whether this type is defined by a module (FALSE) or by a user via Add content type (TRUE).',   `modified` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating whether this type has been modified by an administrator; currently not used in any way.',   `locked` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating whether the administrator can change the machine name of this type.',   `disabled` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating whether the node type is disabled.',   `orig_type` varchar(255) NOT NULL DEFAULT '' COMMENT 'The original machine-readable name of this node type. This may be different from the current type name if the locked field is 0.',   PRIMARY KEY (`type`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores information about all defined node types.';
DROP TABLE IF EXISTS `page_manager_handlers`;
CREATE TABLE `page_manager_handlers` (   `did` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary ID field for the table. Not used for anything except internal lookups.',   `name` varchar(255) DEFAULT NULL COMMENT 'Unique ID for this task handler. Used to identify it programmatically.',   `task` varchar(64) DEFAULT NULL COMMENT 'ID of the task this handler is for.',   `subtask` varchar(64) NOT NULL DEFAULT '' COMMENT 'ID of the subtask this handler is for.',   `handler` varchar(64) DEFAULT NULL COMMENT 'ID of the task handler being used.',   `weight` int(11) DEFAULT NULL COMMENT 'The order in which this handler appears. Lower numbers go first.',   `conf` longtext NOT NULL COMMENT 'Serialized configuration of the handler, if needed.',   PRIMARY KEY (`did`),   UNIQUE KEY `name` (`name`),   KEY `fulltask` (`task`,`subtask`,`weight`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `page_manager_pages`;
CREATE TABLE `page_manager_pages` (   `pid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary ID field for the table. Not used for anything except internal lookups.',   `name` varchar(255) DEFAULT NULL COMMENT 'Unique ID for this subtask. Used to identify it programmatically.',   `task` varchar(64) DEFAULT 'page' COMMENT 'What type of page this is, so that we can use the same mechanism for creating tighter UIs for targeted pages.',   `admin_title` varchar(255) DEFAULT NULL COMMENT 'Human readable title for this page subtask.',   `admin_description` longtext COMMENT 'Administrative description of this item.',   `path` varchar(255) DEFAULT NULL COMMENT 'The menu path that will invoke this task.',   `access` longtext NOT NULL COMMENT 'Access configuration for this path.',   `menu` longtext NOT NULL COMMENT 'Serialized configuration of Drupal menu visibility settings for this item.',   `arguments` longtext NOT NULL COMMENT 'Configuration of arguments for this menu item.',   `conf` longtext NOT NULL COMMENT 'Serialized configuration of the page, if needed.',   PRIMARY KEY (`pid`),   UNIQUE KEY `name` (`name`),   KEY `task` (`task`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Contains page subtasks for implementing pages with...' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `page_manager_weights`;
CREATE TABLE `page_manager_weights` (   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'Unique ID for this task handler. Used to identify it programmatically.',   `weight` int(11) DEFAULT NULL COMMENT 'The order in which this handler appears. Lower numbers go first.',   PRIMARY KEY (`name`),   KEY `weights` (`name`,`weight`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Contains override weights for page_manager handlers that...';
DROP TABLE IF EXISTS `queue`;
CREATE TABLE `queue` (   `item_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique item ID.',   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'The queue name.',   `data` longblob COMMENT 'The arbitrary data for the item.',   `expire` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp when the claim lease expires on the item.',   `created` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp when the item was created.',   PRIMARY KEY (`item_id`),   KEY `name_created` (`name`,`created`),   KEY `expire` (`expire`) ) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='Stores items in queues.' AUTO_INCREMENT=30;
DROP TABLE IF EXISTS `rdf_mapping`;
CREATE TABLE `rdf_mapping` (   `type` varchar(128) NOT NULL COMMENT 'The name of the entity type a mapping applies to (node, user, comment, etc.).',   `bundle` varchar(128) NOT NULL COMMENT 'The name of the bundle a mapping applies to.',   `mapping` longblob COMMENT 'The serialized mapping of the bundle type and fields to RDF terms.',   PRIMARY KEY (`type`,`bundle`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores custom RDF mappings for user defined content types...';
DROP TABLE IF EXISTS `registration`;
CREATE TABLE `registration` (   `registration_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The primary identifier for a registration.',   `type` varchar(32) NOT NULL DEFAULT '' COMMENT 'The registration_type.type of this registration.',   `entity_id` int(11) NOT NULL DEFAULT '0' COMMENT 'The id of the entity this registration is associated with.',   `entity_type` varchar(32) NOT NULL DEFAULT '' COMMENT 'The entity type of the entity this registration is associated with.',   `anon_mail` varchar(254) DEFAULT NULL COMMENT 'Anonymous registrant’s e-mail address.',   `count` int(11) NOT NULL DEFAULT '1' COMMENT 'How many spaces this registration should use towards the total capacity for this event.',   `user_uid` int(11) DEFAULT '0' COMMENT 'The uid of the user associated with this registration.',   `author_uid` int(11) NOT NULL DEFAULT '0' COMMENT 'The uid of the user who created this registration.',   `state` varchar(32) NOT NULL DEFAULT '' COMMENT 'The registration_state.name of this registration.',   `created` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when the registration was created.',   `updated` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when the registration was most recently saved.',   PRIMARY KEY (`registration_id`),   KEY `registration_updated` (`updated`),   KEY `registration_created` (`created`),   KEY `registration_type` (`type`(4)),   KEY `registration_state` (`state`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='The base table for registration module.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `registration_entity`;
CREATE TABLE `registration_entity` (   `entity_id` int(11) NOT NULL COMMENT 'Entity id these registration settings are for.',   `entity_type` varchar(32) NOT NULL DEFAULT '' COMMENT 'The entity type of the entity these registration settings are for.',   `capacity` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Maximum number of users who can signup for this event.',   `status` int(11) NOT NULL DEFAULT '1' COMMENT 'Boolean indicating if registrations are open (1) or closed (0) for the given entity',   `send_reminder` int(11) NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether reminder emails should be sent. This is set to 0 once the reminders are sent.',   `reminder_date` datetime DEFAULT NULL COMMENT 'Date to send the reminder on.',   `reminder_template` longtext COMMENT 'Reminder email template.',   `open` datetime DEFAULT NULL COMMENT 'Date to open registrations. Or NULL to open immediately.',   `close` datetime DEFAULT NULL COMMENT 'Date to close registrations. Or NULL to never close automatically.',   `settings` longblob NOT NULL COMMENT 'A serialized object that stores additional registration settings.',   PRIMARY KEY (`entity_id`,`entity_type`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Registration per-entity settings.';
DROP TABLE IF EXISTS `registration_state`;
CREATE TABLE `registration_state` (   `registration_state_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The registration state ID.',   `name` varchar(128) NOT NULL COMMENT 'The machine name of the registration state.',   `label` varchar(128) NOT NULL COMMENT 'The human readable name of the registration state.',   `description` longtext COMMENT 'The description of the registration state.',   `default_state` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating default registration state.',   `active` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A flag showing active registration states.',   `held` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A flag showing held registration states.',   `show_on_form` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A flag showing if this registration state should be shown on the registration form.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The weight of this  registration state in the UI',   `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'The exportable status of the entity.',   `module` varchar(255) DEFAULT NULL COMMENT 'The name of the providing module if the entity has been defined in code.',   PRIMARY KEY (`registration_state_id`),   UNIQUE KEY `name` (`name`),   KEY `registration_state_name` (`name`),   KEY `registration_state_default_state` (`default_state`) ) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='Stores registration states configuration.' AUTO_INCREMENT=5;
DROP TABLE IF EXISTS `registration_type`;
CREATE TABLE `registration_type` (   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique registration type ID.',   `name` varchar(32) NOT NULL COMMENT 'The machine-readable name of this registration type.',   `label` varchar(255) NOT NULL DEFAULT '' COMMENT 'The human-readable name of this registration type.',   `weight` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'The weight of this registration type in relation to others.',   `locked` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'A boolean indicating whether the administrator may delete this type.',   `default_state` varchar(128) DEFAULT NULL COMMENT 'The machine name of the default registration state.',   `data` longtext COMMENT 'A serialized array of additional data related to this entity_test type.',   `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'The exportable status of the entity.',   `module` varchar(255) DEFAULT NULL COMMENT 'The name of the providing module if the entity has been defined in code.',   PRIMARY KEY (`id`),   UNIQUE KEY `name` (`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores information about all defined registration types.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `registry`;
CREATE TABLE `registry` (   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'The name of the function, class, or interface.',   `type` varchar(9) NOT NULL DEFAULT '' COMMENT 'Either function or class or interface.',   `filename` varchar(255) NOT NULL COMMENT 'Name of the file.',   `module` varchar(255) NOT NULL DEFAULT '' COMMENT 'Name of the module the file belongs to.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The order in which this module’s hooks should be invoked relative to other modules. Equal-weighted modules are ordered by name.',   PRIMARY KEY (`name`,`type`),   KEY `hook` (`type`,`weight`,`module`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Each record is a function, class, or interface name and...';
DROP TABLE IF EXISTS `registry_file`;
CREATE TABLE `registry_file` (   `filename` varchar(255) NOT NULL COMMENT 'Path to the file.',   `hash` varchar(64) NOT NULL COMMENT 'sha-256 hash of the file’s contents when last parsed.',   PRIMARY KEY (`filename`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Files parsed to build the registry.';
DROP TABLE IF EXISTS `role`;
CREATE TABLE `role` (   `rid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique role ID.',   `name` varchar(64) NOT NULL DEFAULT '' COMMENT 'Unique role name.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The weight of this role in listings and the user interface.',   PRIMARY KEY (`rid`),   UNIQUE KEY `name` (`name`),   KEY `name_weight` (`name`,`weight`) ) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='Stores user roles.' AUTO_INCREMENT=4;
DROP TABLE IF EXISTS `role_permission`;
CREATE TABLE `role_permission` (   `rid` int(10) unsigned NOT NULL COMMENT 'Foreign Key: role.rid.',   `permission` varchar(128) NOT NULL DEFAULT '' COMMENT 'A single permission granted to the role identified by rid.',   `module` varchar(255) NOT NULL DEFAULT '' COMMENT 'The module declaring the permission.',   PRIMARY KEY (`rid`,`permission`),   KEY `permission` (`permission`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores the permissions assigned to user roles.';
DROP TABLE IF EXISTS `rules_config`;
CREATE TABLE `rules_config` (   `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'The internal identifier for any configuration.',   `name` varchar(64) NOT NULL COMMENT 'The name of the configuration.',   `label` varchar(255) NOT NULL DEFAULT 'unlabeled' COMMENT 'The label of the configuration.',   `plugin` varchar(127) NOT NULL COMMENT 'The name of the plugin of this configuration.',   `active` int(11) NOT NULL DEFAULT '1' COMMENT 'Boolean indicating whether the configuration is active. Usage depends on how the using module makes use of it.',   `weight` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Weight of the configuration. Usage depends on how the using module makes use of it.',   `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'The exportable status of the entity.',   `dirty` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Dirty configurations fail the integrity check, e.g. due to missing dependencies.',   `module` varchar(255) DEFAULT NULL COMMENT 'The name of the providing module if the entity has been defined in code.',   `owner` varchar(255) NOT NULL DEFAULT 'rules' COMMENT 'The name of the module via which the rule has been configured.',   `access_exposed` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Whether to use a permission to control access for using components.',   `data` longblob COMMENT 'Everything else, serialized.',   PRIMARY KEY (`id`),   UNIQUE KEY `name` (`name`),   KEY `plugin` (`plugin`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `rules_dependencies`;
CREATE TABLE `rules_dependencies` (   `id` int(10) unsigned NOT NULL COMMENT 'The primary identifier of the configuration.',   `module` varchar(255) NOT NULL COMMENT 'The name of the module that is required for the configuration.',   PRIMARY KEY (`id`,`module`),   KEY `module` (`module`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `rules_scheduler`;
CREATE TABLE `rules_scheduler` (   `tid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The scheduled task’s id.',   `config` varchar(64) NOT NULL DEFAULT '' COMMENT 'The scheduled configuration’s name.',   `date` int(11) NOT NULL COMMENT 'The Unix timestamp of when the task is to be scheduled.',   `data` text COMMENT 'The whole, serialized evaluation data.',   `identifier` varchar(255) DEFAULT '' COMMENT 'The user defined string identifying this task.',   `handler` varchar(255) DEFAULT NULL COMMENT 'The fully qualified class name of a the queue item handler.',   PRIMARY KEY (`tid`),   KEY `date` (`date`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores scheduled tasks.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `rules_tags`;
CREATE TABLE `rules_tags` (   `id` int(10) unsigned NOT NULL COMMENT 'The primary identifier of the configuration.',   `tag` varchar(255) NOT NULL COMMENT 'The tag string associated with this configuration',   PRIMARY KEY (`id`,`tag`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `rules_trigger`;
CREATE TABLE `rules_trigger` (   `id` int(10) unsigned NOT NULL COMMENT 'The primary identifier of the configuration.',   `event` varchar(127) NOT NULL DEFAULT '' COMMENT 'The name of the event on which the configuration should be triggered.',   PRIMARY KEY (`id`,`event`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `search_dataset`;
CREATE TABLE `search_dataset` (   `sid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Search item ID, e.g. node ID for nodes.',   `type` varchar(16) NOT NULL COMMENT 'Type of item, e.g. node.',   `data` longtext NOT NULL COMMENT 'List of space-separated words from the item.',   `reindex` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Set to force node reindexing.',   PRIMARY KEY (`sid`,`type`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores items that will be searched.';
DROP TABLE IF EXISTS `search_index`;
CREATE TABLE `search_index` (   `word` varchar(50) NOT NULL DEFAULT '' COMMENT 'The search_total.word that is associated with the search item.',   `sid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The search_dataset.sid of the searchable item to which the word belongs.',   `type` varchar(16) NOT NULL COMMENT 'The search_dataset.type of the searchable item to which the word belongs.',   `score` float DEFAULT NULL COMMENT 'The numeric score of the word, higher being more important.',   PRIMARY KEY (`word`,`sid`,`type`),   KEY `sid_type` (`sid`,`type`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores the search index, associating words, items and...';
DROP TABLE IF EXISTS `search_node_links`;
CREATE TABLE `search_node_links` (   `sid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The search_dataset.sid of the searchable item containing the link to the node.',   `type` varchar(16) NOT NULL DEFAULT '' COMMENT 'The search_dataset.type of the searchable item containing the link to the node.',   `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The node.nid that this item links to.',   `caption` longtext COMMENT 'The text used to link to the node.nid.',   PRIMARY KEY (`sid`,`type`,`nid`),   KEY `nid` (`nid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores items (like nodes) that link to other nodes, used...';
DROP TABLE IF EXISTS `search_total`;
CREATE TABLE `search_total` (   `word` varchar(50) NOT NULL DEFAULT '' COMMENT 'Primary Key: Unique word in the search index.',   `count` float DEFAULT NULL COMMENT 'The count of the word in the index using Zipf’s law to equalize the probability distribution.',   PRIMARY KEY (`word`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores search totals for words.';
DROP TABLE IF EXISTS `semaphore`;
CREATE TABLE `semaphore` (   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'Primary Key: Unique name.',   `value` varchar(255) NOT NULL DEFAULT '' COMMENT 'A value for the semaphore.',   `expire` double NOT NULL COMMENT 'A Unix timestamp with microseconds indicating when the semaphore should expire.',   PRIMARY KEY (`name`),   KEY `value` (`value`),   KEY `expire` (`expire`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Table for holding semaphores, locks, flags, etc. that...';
DROP TABLE IF EXISTS `sequences`;
CREATE TABLE `sequences` (   `value` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The value of the sequence.',   PRIMARY KEY (`value`) ) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='Stores IDs.' AUTO_INCREMENT=4;
DROP TABLE IF EXISTS `services_endpoint`;
CREATE TABLE `services_endpoint` (   `eid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary ID field for the table. Not used for anything except internal lookups.',   `name` varchar(255) NOT NULL COMMENT 'The name of the endpoint.',   `server` varchar(32) NOT NULL COMMENT 'The name of the server used in this endpoint.',   `path` varchar(255) NOT NULL COMMENT 'The path to the endpoint for this server.',   `authentication` longtext NOT NULL COMMENT 'The authentication settings for the endpoint.',   `server_settings` longblob NOT NULL COMMENT 'The server settings for the endpoint.',   `resources` longtext NOT NULL COMMENT 'Information about the resources exposed in this endpoint.',   `debug` int(11) NOT NULL DEFAULT '0' COMMENT 'Set the endpoint in debug mode.',   PRIMARY KEY (`eid`),   UNIQUE KEY `name` (`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores endpoint information for services' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `services_user`;
CREATE TABLE `services_user` (   `uid` int(10) unsigned NOT NULL COMMENT 'User id that has been created by Drupal',   `created` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when the node was most recently created by services.',   `changed` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when the user was most recently updated by services.' ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores users created/updated by services.';
DROP TABLE IF EXISTS `sessions`;
CREATE TABLE `sessions` (   `uid` int(10) unsigned NOT NULL COMMENT 'The users.uid corresponding to a session, or 0 for anonymous user.',   `sid` varchar(128) NOT NULL COMMENT 'A session ID. The value is generated by Drupal’s session handlers.',   `ssid` varchar(128) NOT NULL DEFAULT '' COMMENT 'Secure session ID. The value is generated by Drupal’s session handlers.',   `hostname` varchar(128) NOT NULL DEFAULT '' COMMENT 'The IP address that last used this session ID (sid).',   `timestamp` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when this session last requested a page. Old records are purged by PHP automatically.',   `cache` int(11) NOT NULL DEFAULT '0' COMMENT 'The time of this user’s last post. This is used when the site has specified a minimum_cache_lifetime. See cache_get().',   `session` longblob COMMENT 'The serialized contents of $_SESSION, an array of name/value pairs that persists across page requests by this session ID. Drupal loads $_SESSION from here at the start of each request and saves it at the end.',   PRIMARY KEY (`sid`,`ssid`),   KEY `timestamp` (`timestamp`),   KEY `uid` (`uid`),   KEY `ssid` (`ssid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Drupal’s session handlers read and write into the...';
DROP TABLE IF EXISTS `shortcut_set`;
CREATE TABLE `shortcut_set` (   `set_name` varchar(32) NOT NULL DEFAULT '' COMMENT 'Primary Key: The menu_links.menu_name under which the set’s links are stored.',   `title` varchar(255) NOT NULL DEFAULT '' COMMENT 'The title of the set.',   PRIMARY KEY (`set_name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores information about sets of shortcuts links.';
DROP TABLE IF EXISTS `shortcut_set_users`;
CREATE TABLE `shortcut_set_users` (   `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The users.uid for this set.',   `set_name` varchar(32) NOT NULL DEFAULT '' COMMENT 'The shortcut_set.set_name that will be displayed for this user.',   PRIMARY KEY (`uid`),   KEY `set_name` (`set_name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Maps users to shortcut sets.';
DROP TABLE IF EXISTS `system`;
CREATE TABLE `system` (   `filename` varchar(255) NOT NULL DEFAULT '' COMMENT 'The path of the primary file for this item, relative to the Drupal root; e.g. modules/node/node.module.',   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'The name of the item; e.g. node.',   `type` varchar(12) NOT NULL DEFAULT '' COMMENT 'The type of the item, either module, theme, or theme_engine.',   `owner` varchar(255) NOT NULL DEFAULT '' COMMENT 'A theme’s ’parent’ . Can be either a theme or an engine.',   `status` int(11) NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether or not this item is enabled.',   `bootstrap` int(11) NOT NULL DEFAULT '0' COMMENT 'Boolean indicating whether this module is loaded during Drupal’s early bootstrapping phase (e.g. even before the page cache is consulted).',   `schema_version` smallint(6) NOT NULL DEFAULT '-1' COMMENT 'The module’s database schema version number. -1 if the module is not installed (its tables do not exist); 0 or the largest N of the module’s hook_update_N() function that has either been run or existed when the module was first installed.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The order in which this module’s hooks should be invoked relative to other modules. Equal-weighted modules are ordered by name.',   `info` blob COMMENT 'A serialized array containing information from the module’s .info file; keys can include name, description, package, version, core, dependencies, and php.',   PRIMARY KEY (`filename`),   KEY `system_list` (`status`,`bootstrap`,`type`,`weight`,`name`),   KEY `type_name` (`type`,`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='A list of all modules, themes, and theme engines that are...';
DROP TABLE IF EXISTS `taxonomy_index`;
CREATE TABLE `taxonomy_index` (   `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The node.nid this record tracks.',   `tid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The term ID.',   `sticky` tinyint(4) DEFAULT '0' COMMENT 'Boolean indicating whether the node is sticky.',   `created` int(11) NOT NULL DEFAULT '0' COMMENT 'The Unix timestamp when the node was created.',   KEY `term_node` (`tid`,`sticky`,`created`),   KEY `nid` (`nid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Maintains denormalized information about node/term...';
DROP TABLE IF EXISTS `taxonomy_term_data`;
CREATE TABLE `taxonomy_term_data` (   `tid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique term ID.',   `vid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The taxonomy_vocabulary.vid of the vocabulary to which the term is assigned.',   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'The term name.',   `description` longtext COMMENT 'A description of the term.',   `format` varchar(255) DEFAULT NULL COMMENT 'The filter_format.format of the description.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The weight of this term in relation to other terms.',   PRIMARY KEY (`tid`),   KEY `taxonomy_tree` (`vid`,`weight`,`name`),   KEY `vid_name` (`vid`,`name`),   KEY `name` (`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores term information.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `taxonomy_term_hierarchy`;
CREATE TABLE `taxonomy_term_hierarchy` (   `tid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Primary Key: The taxonomy_term_data.tid of the term.',   `parent` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Primary Key: The taxonomy_term_data.tid of the term’s parent. 0 indicates no parent.',   PRIMARY KEY (`tid`,`parent`),   KEY `parent` (`parent`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores the hierarchical relationship between terms.';
DROP TABLE IF EXISTS `taxonomy_vocabulary`;
CREATE TABLE `taxonomy_vocabulary` (   `vid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique vocabulary ID.',   `name` varchar(255) NOT NULL DEFAULT '' COMMENT 'Name of the vocabulary.',   `machine_name` varchar(255) NOT NULL DEFAULT '' COMMENT 'The vocabulary machine name.',   `description` longtext COMMENT 'Description of the vocabulary.',   `hierarchy` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'The type of hierarchy allowed within the vocabulary. (0 = disabled, 1 = single, 2 = multiple)',   `module` varchar(255) NOT NULL DEFAULT '' COMMENT 'The module which created the vocabulary.',   `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The weight of this vocabulary in relation to other vocabularies.',   PRIMARY KEY (`vid`),   UNIQUE KEY `machine_name` (`machine_name`),   KEY `list` (`weight`,`name`) ) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='Stores vocabulary information.' AUTO_INCREMENT=2;
DROP TABLE IF EXISTS `themekey_properties`;
CREATE TABLE `themekey_properties` (   `id` int(10) unsigned NOT NULL AUTO_INCREMENT,   `property` varchar(255) NOT NULL DEFAULT '',   `operator` varchar(2) NOT NULL DEFAULT '=',   `value` varchar(255) NOT NULL DEFAULT '',   `weight` int(11) NOT NULL DEFAULT '0',   `theme` varchar(255) NOT NULL DEFAULT '',   `enabled` int(10) unsigned NOT NULL DEFAULT '0',   `wildcards` longtext NOT NULL,   `parent` int(10) unsigned NOT NULL DEFAULT '0',   `module` varchar(255) NOT NULL DEFAULT '' COMMENT 'The name of the module that created this entry.',   PRIMARY KEY (`id`),   KEY `enabled_parent_weight` (`enabled`,`parent`,`weight`),   KEY `parent_weight` (`parent`,`weight`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `themekey_ui_author_theme`;
CREATE TABLE `themekey_ui_author_theme` (   `uid` int(10) unsigned NOT NULL COMMENT 'The user id.',   `theme` varchar(255) NOT NULL DEFAULT '',   PRIMARY KEY (`uid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `themekey_ui_node_theme`;
CREATE TABLE `themekey_ui_node_theme` (   `nid` int(10) unsigned NOT NULL COMMENT 'The node this version belongs to.',   `vid` int(10) unsigned NOT NULL COMMENT 'The primary identifier for this version.',   `theme` varchar(255) NOT NULL DEFAULT '',   PRIMARY KEY (`nid`,`vid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `url_alias`;
CREATE TABLE `url_alias` (   `pid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'A unique path alias identifier.',   `source` varchar(255) NOT NULL DEFAULT '' COMMENT 'The Drupal path this alias is for; e.g. node/12.',   `alias` varchar(255) NOT NULL DEFAULT '' COMMENT 'The alias for this path; e.g. title-of-the-story.',   `language` varchar(12) NOT NULL DEFAULT '' COMMENT 'The language this alias is for; if ’und’, the alias will be used for unknown languages. Each Drupal path can have an alias for each supported language.',   PRIMARY KEY (`pid`),   KEY `alias_language_pid` (`alias`,`language`,`pid`),   KEY `source_language_pid` (`source`,`language`,`pid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='A list of URL aliases for Drupal paths; a user may visit...' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (   `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Primary Key: Unique user ID.',   `name` varchar(60) NOT NULL DEFAULT '' COMMENT 'Unique user name.',   `pass` varchar(128) NOT NULL DEFAULT '' COMMENT 'User’s password (hashed).',   `mail` varchar(254) DEFAULT '' COMMENT 'User’s e-mail address.',   `theme` varchar(255) NOT NULL DEFAULT '' COMMENT 'User’s default theme.',   `signature` varchar(255) NOT NULL DEFAULT '' COMMENT 'User’s signature.',   `signature_format` varchar(255) DEFAULT NULL COMMENT 'The filter_format.format of the signature.',   `created` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp for when user was created.',   `access` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp for previous time user accessed the site.',   `login` int(11) NOT NULL DEFAULT '0' COMMENT 'Timestamp for user’s last login.',   `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Whether the user is active(1) or blocked(0).',   `timezone` varchar(32) DEFAULT NULL COMMENT 'User’s time zone.',   `language` varchar(12) NOT NULL DEFAULT '' COMMENT 'User’s default language.',   `picture` int(11) NOT NULL DEFAULT '0' COMMENT 'Foreign key: file_managed.fid of user’s picture.',   `init` varchar(254) DEFAULT '' COMMENT 'E-mail address used for initial account creation.',   `data` longblob COMMENT 'A serialized array of name value pairs that are related to the user. Any form values posted during user edit are stored and are loaded into the $user object during user_load(). Use of this field is discouraged and it will likely disappear in a future...',   PRIMARY KEY (`uid`),   UNIQUE KEY `name` (`name`),   KEY `access` (`access`),   KEY `created` (`created`),   KEY `mail` (`mail`),   KEY `picture` (`picture`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores user data.';
DROP TABLE IF EXISTS `users_roles`;
CREATE TABLE `users_roles` (   `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Primary Key: users.uid for user.',   `rid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Primary Key: role.rid for role.',   PRIMARY KEY (`uid`,`rid`),   KEY `rid` (`rid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Maps users to roles.';
DROP TABLE IF EXISTS `variable`;
CREATE TABLE `variable` (   `name` varchar(128) NOT NULL DEFAULT '' COMMENT 'The name of the variable.',   `value` longblob NOT NULL COMMENT 'The value of the variable.',   PRIMARY KEY (`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Named variable/value pairs created by Drupal core or any...';
DROP TABLE IF EXISTS `views_display`;
CREATE TABLE `views_display` (   `vid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The view this display is attached to.',   `id` varchar(64) NOT NULL DEFAULT '' COMMENT 'An identifier for this display; usually generated from the display_plugin, so should be something like page or page_1 or block_2, etc.',   `display_title` varchar(64) NOT NULL DEFAULT '' COMMENT 'The title of the display, viewable by the administrator.',   `display_plugin` varchar(64) NOT NULL DEFAULT '' COMMENT 'The type of the display. Usually page, block or embed, but is pluggable so may be other things.',   `position` int(11) DEFAULT '0' COMMENT 'The order in which this display is loaded.',   `display_options` longtext COMMENT 'A serialized array of options for this display; it contains options that are generally only pertinent to that display plugin type.',   PRIMARY KEY (`vid`,`id`),   KEY `vid` (`vid`,`position`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores information about each display attached to a view.';
DROP TABLE IF EXISTS `views_view`;
CREATE TABLE `views_view` (   `vid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The view ID of the field, defined by the database.',   `name` varchar(128) NOT NULL DEFAULT '' COMMENT 'The unique name of the view. This is the primary field views are loaded from, and is used so that views may be internal and not necessarily in the database. May only be alphanumeric characters plus underscores.',   `description` varchar(255) DEFAULT '' COMMENT 'A description of the view for the admin interface.',   `tag` varchar(255) DEFAULT '' COMMENT 'A tag used to group/sort views in the admin interface',   `base_table` varchar(64) NOT NULL DEFAULT '' COMMENT 'What table this view is based on, such as node, user, comment, or term.',   `human_name` varchar(255) DEFAULT '' COMMENT 'A human readable name used to be displayed in the admin interface',   `core` int(11) DEFAULT '0' COMMENT 'Stores the drupal core version of the view.',   PRIMARY KEY (`vid`),   UNIQUE KEY `name` (`name`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores the general data for a view.' AUTO_INCREMENT=1;
DROP TABLE IF EXISTS `watchdog`;
CREATE TABLE `watchdog` (   `wid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique watchdog event ID.',   `uid` int(11) NOT NULL DEFAULT '0' COMMENT 'The users.uid of the user who triggered the event.',   `type` varchar(64) NOT NULL DEFAULT '' COMMENT 'Type of log message, for example `user` or `page not found.`',   `message` longtext NOT NULL COMMENT 'Text of log message to be passed into the t() function.',   `variables` longblob NOT NULL COMMENT 'Serialized array of variables that match the message string and that is passed into the t() function.',   `severity` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'The severity level of the event; ranges from 0 (Emergency) to 7 (Debug)',   `link` varchar(255) DEFAULT '' COMMENT 'Link to view the result of the event.',   `location` text NOT NULL COMMENT 'URL of the origin of the event.',   `referer` text COMMENT 'URL of referring page.',   `hostname` varchar(128) NOT NULL DEFAULT '' COMMENT 'Hostname of the user who triggered the event.',   `timestamp` int(11) NOT NULL DEFAULT '0' COMMENT 'Unix timestamp of when event occurred.',   PRIMARY KEY (`wid`),   KEY `type` (`type`),   KEY `uid` (`uid`),   KEY `severity` (`severity`) ) ENGINE=InnoDB AUTO_INCREMENT=200 DEFAULT CHARSET=utf8 COMMENT='Table that contains logs of all system events.' AUTO_INCREMENT=200;
DROP TABLE IF EXISTS `workbench_moderation_node_history`;
CREATE TABLE `workbench_moderation_node_history` (   `hid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Node history entry key.',   `vid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Node revision id. Foreign key to node_revision',   `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Node id. Foreign key to node',   `from_state` varchar(255) DEFAULT NULL COMMENT 'The old moderation state of the node',   `state` varchar(255) DEFAULT NULL COMMENT 'The current moderation state of the node.',   `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The user id of the moderator who made the change. Foreign key to users.',   `stamp` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The timestamp of the change.',   `published` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Indicated the live revision of a node.',   `is_current` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Indicated the current revision of a node.',   PRIMARY KEY (`hid`),   KEY `nid` (`nid`),   KEY `vid` (`vid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1;
