DROP TABLE IF EXISTS `wysiwyg`;
CREATE TABLE `wysiwyg` (   `format` varchar(255) NOT NULL COMMENT 'The filter_format.format of the text format.',   `editor` varchar(128) NOT NULL DEFAULT '' COMMENT 'Internal name of the editor attached to the text format.',   `settings` text COMMENT 'Configuration settings for the editor.',   PRIMARY KEY (`format`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores Wysiwyg profiles.';
